import { Header } from 'antd/es/layout/layout';
import './App.css';
import SideMenu from './components/SideMenu/dashboard';
import { Layout, Space } from 'antd';



function App() {
  return (
    <Layout>

        <Header style={{fontSize:'40px'}}>Dashboard</Header>
        <div className="App">
          <Space>
            <SideMenu></SideMenu>

           </Space>
      </div>
    </Layout>
  );
}

export default App;
